import React, { Component } from 'react';
import { ScrollView, Text } from 'react-native';

class FriendsList extends Component {
  render() {
    return (
      <ScrollView>
        <Text> Friends List </Text>
      </ScrollView>
    );
  }
}

export default FriendsList;
